import { useEffect, useState } from "react"
import { useSelector } from "react-redux"


function Grades(){
    const [grades,setGrades]= useState()
    const utis = useSelector(state=>state.class.class);
    useEffect(()=>{
        const res = fetch("http://localhost:8000/gradesof/"+utis)
        if(res.ok){
            setGrades(res.json())
            console.log(res.json())
        }
    },[])
    return <>{grades}</>

}

export default Grades
